Dirty Business: &lt;#&gt;&lt;#&gt;&lt;#&gt;&lt;#&gt;Follow an eclectic crew from a leading landscape design firm that create breath taking outdoor spaces&lt;#&gt;&lt;#&gt;&lt;#&gt;&lt;#&gt;

Parkside Paradise

This is one weirdly positioned house. The side faces the street and the front faces a park. Guests are confused when they arrive. Dirty Business host Kennedy McRae makes this home make sense by introducing traffic flow and squeezing the most from fixed elements to enhance its vintage charm. No detail escapes this budget-wary project
